import React, { useState, useEffect } from "react";
import "../styles/UserDashboard.css";
import { FaUserCircle } from "react-icons/fa";
import hostelImage from "../assets/hostelroom.jpg";

// Log hostelImage immediately after import
console.log("Hostel Image Path: ", hostelImage);

function UserDashboard() {
  const [dropdownOpen, setDropdownOpen] = useState(false);
  const [user, setUser] = useState(null); // State to store user data

  const toggleDropdown = () => {
    setDropdownOpen(!dropdownOpen);
  };

  // Example useEffect to simulate setting the user object after login
  useEffect(() => {
    // Simulating a successful login with user data
    const userData = {
      name: "Stella",
      email: "stella123@example.com",
      phone: "8921857620",
    };
    setUser(userData);
  }, []);

  return (
    <div className="dashboard">
      {/* Header */}
      <header className="header">
        <div className="logo">BOOKmyHOSTEL</div>
        <nav className="nav-links">
          <a href="/">Home</a>
          <a href="/search">Search Hostels</a>
          <a href="/reviews">Reviews</a>
          <a href="/contact">Contact Us</a>
        </nav>
        <div className="user-dropdown">
          <FaUserCircle className="user-icon" onClick={toggleDropdown} />
          {dropdownOpen && (
            <div className="dropdown-menu">
              <a href="/profile">Profile</a>
              <a href="/edit-profile">Edit Profile</a>
              <a href="/saved-hostels">Saved Hostels</a>
              <a href="/logout">Log Out</a>
            </div>
          )}
        </div>
      </header>

      {/* Hero Section with Background Image */}
      <section className="hero">
        <div className="hero-section">
          <img src={hostelImage} alt="Hostel Room" />
          <h1>Welcome, {user ? user.name : "User"}!</h1> {/* Displaying user name */}
          <div className="search-bar">
            <input type="text" placeholder="Search hostels..." />
            <button>Search</button>
          </div>
        </div>
      </section>

      {/* Recently Booked Hostels (Placeholder UI) */}
      <section className="recent-bookings">
        <h2>Your Recent Bookings</h2>
        <div className="card-container">
          {/* Mocked booking card */}
          <div className="card">
            <div className="card-details">
              <h3>Aiswarya Hostel</h3>
              <p>University Road, Kochi, Kerala 682022</p>
              <p>Review: ⭐4.5</p>
              <p>Fees Paid: ₹8000</p>
              <p className="confirmed">Confirmed</p>
              <button className="view-details">View Details</button>
            </div>
          </div>
        </div>
      </section>

      {/* User Info (Displaying user email and phone number as an example) */}
      <section className="user-info">
        {user && (
          <>
            <p>Email: {user.email}</p>
            <p>Phone: {user.phone}</p>
          </>
        )}
      </section>
    </div>
  );
}

export default UserDashboard;
